import photo19 from "../../Assets/Photos/19.jpg";
import photo20 from "../../Assets/Photos/20.jpg";
import photo21 from "../../Assets/Photos/21.jpg";


const Gallery = () => {
  let data = [
    {
      id: 1,
      imgSrc: photo1,
    },
    {
      id: 2,
      imgSrc: photo2,
    },
    {
